
-- Table: dow
DROP TABLE IF EXISTS dow;
CREATE TABLE dow (
	id INTEGER, 
	quarter INTEGER, 
	stock VARCHAR(255), 
	date VARCHAR(255), 
	open_price FLOAT, 
	high_price FLOAT, 
	low_price FLOAT, 
	close_price FLOAT, 
	volume INTEGER, 
	percent_change FLOAT, 
	PRIMARY KEY (id)
);

COMMIT TRANSACTION;
PRAGMA foreign_keys = on;
